import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const UpdateCar = () => {
  return (
    <View>
      <Text>UpdateCar</Text>
    </View>
  )
}

export default UpdateCar

const styles = StyleSheet.create({})
